import { createClient } from '@supabase/supabase-js';

// Valores de Supabase
const supabaseUrl = 'https://pmsdftbtjxliqogheopm.supabase.co';
const supabaseAnonKey = 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpc3MiOiJzdXBhYmFzZSIsInJlZiI6InBtc2RmdGJ0anhsaXFvZ2hlb3BtIiwicm9sZSI6ImFub24iLCJpYXQiOjE3MDk5MjQ5NzAsImV4cCI6MjAyNTUwMDk3MH0.8X5X5X5X5X5X5X5X5X5X5X5X5X5X5X5X5X5X5X5X5X';

// Crear el cliente de Supabase
const supabase = createClient(supabaseUrl, supabaseAnonKey, {
    auth: {
        persistSession: true,
        autoRefreshToken: true,
        detectSessionInUrl: true,
        storageKey: 'supabase.auth.token'
    },
    db: {
        schema: 'public'
    }
});

// Verificar la conexión
supabase.auth.onAuthStateChange((event, session) => {
    console.log('Estado de autenticación:', event, session ? 'sesión activa' : 'sin sesión');
});

export { supabase };
